import React from 'react';
import { connect } from 'react-redux';
import { logoutUser } from '../actions/actions';

function Dashboard(props) {
  // const onLogoutClick = e => {
  //   e.preventDefault();
  //   props.logoutUser();
  // };
  const { user } = props.auth;
  console.log(user);
  const premiumBtn = (
    <button className="btn btn-success">VUELVETE PREMIUM</button>
  );
  return (
    <div>
      <div style={{ width: '100vw', height: '25vh' }}>
        <img
          id="login"
          className="h-100 w-100 p-0"
          src="/assets/img/register.jpeg"
          alt="login"
        />
      </div>
      <div className="container d-flex w-100 h-75 p-0">
        <div className="row justify-content-center align-self-center m-auto p-0 w-100">
          <div className="container w-100">
            <div className="row">
              <div className="col-md-12 ">
                <div className="container ">
                  <div className="row modal-header">
                    <h1 className="col-md-12 text-center modal-title ">
                      Â¡Hola {user.name.split(' ')[0]}!
                      {/* <i className="em em-alien m-3" /> */}
                    </h1>
                    <h5 className="col-md-12 text-center">
                      {user.isPremium ? 'TU CUENTA ES PREMIUM' : premiumBtn}
                    </h5>
                  </div>
                  <div className="row ">
                    <div className="container">
                      {/* ================================INFO================================== */}
                      <div className="row my-3 w-100">
                        <div className="col-md-6 my-2 mx-auto text-center">
                          <img
                            className=" m-auto w-25"
                            src={user.photo}
                            alt={user.name}
                          />
                          <h1 className="text-center">Tu Informacion</h1>
                          <table className="table table-striped table-sm text-left">
                            <tbody>
                              <tr>
                                <td>EMAIL </td>
                                <td>{user.email}</td>
                              </tr>
                              <tr>
                                <td>NOMBRE </td>
                                <td>{user.name}</td>
                              </tr>
                              <tr>
                                <td>DESDE </td>
                                <td>{user.since.split('-')[0]}</td>
                              </tr>
                              <tr>
                                <td>TIPO DE CUENTA </td>
                                <td>
                                  {user.isPremium ? 'PREMIUM' : 'REGULAR'}{' '}
                                </td>
                              </tr>
                              <tr>
                                <td>TELEFONO </td>
                                <td>
                                  {user.isPremium ? 'PREMIUM' : 'REGULAR'}{' '}
                                </td>
                              </tr>
                              <tr>
                                <td>TIPO DE CUENTA </td>
                                <td>
                                  {user.isPremium ? 'PREMIUM' : 'REGULAR'}{' '}
                                </td>
                              </tr>
                            </tbody>
                          </table>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>{' '}
      </div>
    </div>
  );
}

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
